import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './SignInPage.css';

function SignInPage(props) {
  const { updateUserData, propertyValue, buildingAge, carpetArea, pincode, security24x7, premium, propertyEffect, isSalaried } = props;
  const navigate = useNavigate();
  
  const [FullName, setFullName] = useState('');
  const [Mobile, setMobile] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    const isValid = validateInputs();

    if (isValid) {
      const formData = {
        fullName: FullName,
        mobile: Mobile,
        email: Email,
        password: password,
      };

      axios.post('http://localhost:9855/api/signin/add', formData)
        .then(response => {
          updateUserData({ FullName, Mobile, Email });
          navigate('/success');
        })
        .catch(error => {
          console.error('Sign in failed:', error);
          if (error.response && error.response.status === 409) {
            setErrorMessages(prevErrors => ({
              ...prevErrors,
              Mobile: 'Mobile number already exists. Kindly switch to SignUp.',
            }));
          } else {
            setErrorMessages(prevErrors => ({
              ...prevErrors,
              Mobile: 'Number already exists. Kindly switch to Login.',
            }));
          }
        });

      // Only send property data to the database if sign in is successful
      if (!errorMessages.Mobile) {
        const propertyData = {
          propertyValue: propertyValue,
          carpetArea: carpetArea,
          pincode: pincode,
          security24x7: security24x7,
          premium: premium,
          buildingAge: buildingAge,
          propertyEffect: propertyEffect,
          isSalaried: isSalaried,
          mobile: Mobile
        };

        axios.post('http://localhost:9855/api/property/add', propertyData)
          .then(response => {
            console.log('Property data saved successfully:', response.data);
            // Handle success response if needed
          })
          .catch(error => {
            console.error('Error saving property data:', error);
            // Handle error response if needed
          });
      }
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };

  const validateInputs = () => {
    // Validation logic goes here
  };

  return (
    <div className="fcontainer">
      <div className="row justify-content-center">
        <div className="col-md-8">
          <form onSubmit={handleSubmit} className="mt-5">
            <div className="form-group">
              <label>FullName:</label>
              <input
                type="text"
                className="form-control"
                placeholder="ex: FullName"
                value={FullName}
                onChange={(e) => setFullName(e.target.value)}
              />
              <small className="text-danger">{errorMessages.FullName}</small>
            </div>

            <div className="form-group">
              <label>MobileNo:</label>
              <input
                type="text"
                className="form-control"
                placeholder="ex: 9876543210"
                value={Mobile}
                maxLength={10}
                onChange={(e) => setMobile(e.target.value)}
              />
              <small className="text-danger">{errorMessages.Mobile}</small>
            </div>

            <div className="form-group">
              <label>EmailId:</label>
              <input
                type="text"
                className="form-control"
                placeholder="ex: example@gmail.com"
                value={Email}
                onChange={(e) => setEmail(e.target.value)}
              />
              <small className="text-danger">{errorMessages.Email}</small>
            </div>
            
            <div className="form-group">
              <label>Password:</label>
              <input
                type="password"
                className="form-control"
                placeholder="ex: Abc@123"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              <small className="text-danger">{errorMessages.password}</small>
            </div>

            <button className="btn btn-success mt-3 mb-4" type="submit">
              Sign In
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default SignInPage;
